import React, { Component } from "react";
import GoToPage from "../src/components/GoToPage";

class About extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        <div>About page</div>
        <br />
        <GoToPage toPage={"/index"} />
      </div>
    );
  }
}

export default About;
